// src/pages/ProtectionKits.jsx
import useArmouryData from "../hooks/useArmouryData";
import { useCart } from "../context/CartContext";
import { useNavigate } from "react-router-dom";

export default function ProtectionKits() {
  const kits = useArmouryData("protectionKits");
  const { addToCart } = useCart();
  const navigate = useNavigate();
  
  return (
    <div className="min-h-screen bg-black py-12 px-4">
      <div className="max-w-7xl mx-auto">
        {/* Header Section */}
        <div className="text-center mb-12">
          <h1 className="text-5xl font-bold death-text mb-4">
            💀 DEATH'S ARMOURY 💀
          </h1>
          <h2 className="text-3xl text-red-400 font-mono mb-2">
            PROTECTION KITS
          </h2>
          <p className="text-gray-400 text-lg">
            "Only the worthy survive Death's embrace"
          </p>
        </div>

        {/* Protection Kits Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {kits.map((kit, idx) => (
            <div 
              key={idx} 
              className="weapon-card bg-gray-900/80 backdrop-blur-sm border-2 border-red-800 rounded-lg overflow-hidden transform transition-all duration-500 hover:scale-105 hover:border-red-600"
            >
              {/* Image Section */}
              <div className="relative h-64 bg-gradient-to-b from-red-950/50 to-black">
                {kit.image ? (
                  <img 
                    src={kit.image} 
                    alt={kit.name}
                    className="w-full h-full object-cover"
                  />
                ) : (
                  <div className="w-full h-full flex items-center justify-center">
                    <span className="text-6xl">🛡️</span>
                  </div>
                )}
                <div className="absolute inset-0 bg-gradient-to-t from-black/80 to-transparent"></div>
                <div className="absolute top-4 left-4">
                  <span className="bg-red-900/80 text-red-300 px-3 py-1 rounded-full text-sm font-bold">
                    LEVEL {kit.level || "DEATH"}
                  </span>
                </div>
              </div>

              {/* Content Section */}
              <div className="p-6">
                <h3 className="text-2xl font-bold text-red-400 mb-2 font-mono">
                  {kit.name}
                </h3>
                
                <div className="space-y-3 mb-4">
                  <div className="flex justify-between items-center">
                    <span className="text-gray-400">Protection Level:</span>
                    <span className="text-red-400 font-bold">{kit.protection}</span>
                  </div>
                  
                  {kit.material && (
                    <div className="flex justify-between items-center">
                      <span className="text-gray-400">Material:</span>
                      <span className="text-red-300">{kit.material}</span>
                    </div>
                  )}
                  
                  {kit.weight && (
                    <div className="flex justify-between items-center">
                      <span className="text-gray-400">Weight:</span>
                      <span className="text-red-300">{kit.weight}</span>
                    </div>
                  )}
                  
                  {kit.special && (
                    <div className="mt-4 p-3 bg-red-950/30 rounded border border-red-800/50">
                      <span className="text-red-400 font-bold">⚠️ SPECIAL FEATURES:</span>
                      <p className="text-gray-300 text-sm mt-1">{kit.special}</p>
                    </div>
                  )}
                </div>

                <div className="mt-6">
                  <button 
                    onClick={() => {
                      addToCart({
                        name: kit.name,
                        type: "Protection Kit",
                        price: kit.price || "$999",
                        image: kit.image,
                        protection: kit.protection,
                        material: kit.material,
                        weight: kit.weight,
                        special: kit.special
                      });
                      navigate('/cart');
                    }}
                    className="w-full bg-gradient-to-r from-red-900 to-red-800 hover:from-red-800 hover:to-red-700 text-white font-bold py-3 px-4 rounded transition-all duration-300 transform hover:scale-105"
                  >
                    CLAIM PROTECTION
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* Warning Section */}
        <div className="mt-12 bg-red-950/20 border-2 border-red-800 rounded-lg p-6">
          <h3 className="text-2xl text-red-400 font-bold mb-4 text-center">
            ⚠️ DEATH'S WARNING ⚠️
          </h3>
          <p className="text-gray-300 text-center">
            These protection kits have been forged in the fires of Death's realm. 
            They offer protection against the most devastating attacks, but remember - 
            <span className="text-red-400 font-bold"> Death always collects his due.</span>
          </p>
        </div>
      </div>
    </div>
  );
}
